var prev_handler_before_imgpreload = window.onload
window.onload = function loadStuff() {
  prev_handler_before_imgpreload && prev_handler_before_imgpreload()
  console.log("dsfjsldjbls")
  var win, doc, img, header, enhancedClass;
  
  // Quit early if older browser (e.g. IE 8).
  if (!('addEventListener' in window)) {
    return;
  }
  
  win = window;
  doc = win.document;
  img = new Image();
  header = doc.querySelector('.blog-hero');
  enhancedClass = 'enhanced';

  // Rather convoluted, but parses out the first mention of a background
  // image url for the enhanced header, even if the style is not applied.
  var bigSrc = "assets/images/blog_hero.jpeg";
  console.log(bigSrc)
  // Assign an onLoad handler to the dummy image *before* assigning the src
  img.onload = function () {
    header.className += '_' +enhancedClass;
  };
  // Finally, trigger the whole preloading chain by giving the dummy
  // image its source.
  if (bigSrc) {
    img.src = bigSrc;
    console.log(img)
  }
};

